import { Link } from "react-router-dom";
import React, { useEffect } from "react";
import "../styles/home.css";
import 'materialize-css/dist/css/materialize.min.css';


import ott1 from '../img/ott1.webp';
import ott2 from '../img/ott2.webp';
import ott3 from '../img/ott3.webp';
library.add(fas);

function HomePage() {  
  return (
    <>
    <div className="container">
      <div className="slide">
      <div className="item" style={{ backgroundImage: `url(${ott1})` }}></div>
      
      </div>
    </div>
    </>
  );
}
export default HomePage;
